import '../App.css'
import React from 'react'
import { BrowserRouter as Router, Link } from 'react-router-dom'

function Footer() {
  return(
      <nav>
        <ul>
          <li>
            <Link to="/creopalette">Home</Link>
          </li>
        </ul>
      </nav>
  )
}

export default Footer;
